function App() {

    return (

      <div className="App">
        <MyAppBar  />
        <BrowserRouter>

           <Switch>
           <Route path="/hire" component={Hire}></Route>      
           <Route path="/createPost" component={CreatePost}></Route>    


            </Switch>
        </BrowserRouter> 
      </div>
    );
}

export default App;
